import Link from "next/link";
import Layout from "../components/Layout";

const Index = ({}) => {
  return (
    <div>
      <Link href='/about'>
        <a title='About Page'>About Page</a>
      </Link>
      <Layout>
        <p>Hello Next.js</p>
      </Layout>
    </div>
  );
};

export default Index;
